&lt;p&gt;A. He was in the habit of stealing food from others.&lt;/p&gt;

&lt;p&gt;B. One night, the villagers decided to teach him a lesson and kept only rotten food in their kitchen.&lt;/p&gt;

&lt;p&gt;C. The culprit ended up eating the rotten food and fell sick.&lt;/p&gt;

&lt;p&gt;D. Once upon a time, there lived a man in a village.&lt;/p&gt;
